description:
Treha Sektori is a dark/ritual ambient project ran by Dehn Sora (Sembler Deah, Church Of Ra). Treha Sektori means &quot;the place where they fall&quot;, formed in 2005 from a feeling of absence, to express through instinctive language and silent odes a falling towards the Sun.




2009 - Sorieh
2012 - Severh Devrah (Cyclic Law's 10th Year Anniversary Label Sampler) [Flac]
2013 - Endessiah
2014 - Severh Sehenh

All albums are in 320kbits/s (unless otherwise specified)


Enjoy, seed and support the band.

